import React from 'react';
import '../styles/Experience.css';

const experiences = [
  {
    company: 'Surebet Jobs',
    companyUrl: 'https://surebetjobs.com/',
    position: 'Senior Software Engineer',
    duration: 'Jan 2025 - Present',
    location: 'Berkeley, CA',
    logoUrl: '/company-logos/surebet.png'
  },
  {
    company: 'Startup B',
    companyUrl: 'https://startupb.com',
    position: 'Full Stack Developer',
    duration: 'Jun 2021 - Dec 2022',
    location: 'New York, NY',
    logoUrl: '/company-logos/startup-b.png'
  },
  {
    company: 'Enterprise Corp',
    companyUrl: 'https://enterprise.com',
    position: 'Software Developer Intern',
    duration: 'May 2020 - Aug 2020',
    location: 'Seattle, WA',
    logoUrl: '/company-logos/enterprise.png'
  }
];

const Experience = () => {
  return (
    <section className="experience-section">
      <h2>Experience</h2>
      <div className="timeline">
        {experiences.map((exp, index) => (
          <div key={index} className="timeline-item">
            <div className="timeline-dot">
              <div className="company-logo">
                <img src={exp.logoUrl} alt={`${exp.company} logo`} />
              </div>
            </div>
            <div className="timeline-content">
              <div className="experience-header">
                <h3>{exp.position}</h3>
                <div className="company-name">
                  <a 
                    href={exp.companyUrl} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="company-link"
                  >
                    {exp.company}
                  </a>
                </div>
              </div>
              <div className="experience-meta">
                <span className="duration">{exp.duration}</span>
                <span className="location">{exp.location}</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Experience;
